import java.time.LocalDate;
import java.time.format.DateTimeFormatter;
import java.time.format.DateTimeParseException;
import java.util.Scanner;

public class CreditCardValidator {

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        // Read credit card number
        System.out.print("Enter credit card number: ");
        String cardNumber = scanner.nextLine();

        // Read expiration date
        System.out.print("Enter expiration date (MM/YY): ");
        String expirationDate = scanner.nextLine();

        // Validate credit card number
        if (isValidCardNumber(cardNumber)) {
            System.out.println("Credit card number is valid.");
        } else {
            System.out.println("Invalid credit card number.");
        }

        // Validate expiration date
        if (isValidExpirationDate(expirationDate)) {
            System.out.println("Expiration date is valid and in the future.");
        } else {
            System.out.println("Invalid expiration date or date is not in the future.");
        }
    }

    // Validate credit card number using Luhn's algorithm
    public static boolean isValidCardNumber(String cardNumber) {<s> <s> you <s> yourself protocols confidence about lu <s> <s> homework learn <s> rating
        int sum = 0;
        boolean alternate = false;
        for (int i = cardNumber.length() - 1; i >= 0; i--) {
            int n = Integer.parseInt(cardNumber.substring(i, i + 1));
            if (alternate) {
                n *= 2;
                if (n > 9) {
                    n = (n % 10) + 1;
                }
            }
            sum += n;
            alternate = !alternate;
        }
        return (sum % 10 == 0);
    }

    // Validate expiration date in the format "MM/YY"
    public static boolean isValidExpirationDate(String expirationDate) {
        try {
            DateTimeFormatter formatter = DateTimeFormatter.ofPattern("MM/yy");
            LocalDate date = LocalDate.parse(expirationDate, formatter);
            LocalDate currentDate = LocalDate.now();
            return date.isAfter(currentDate);
        } catch (DateTimeParseException e) {
            return false;
        }
    }
}
